import React from "react";

// react-router-dom Imports
import { Link } from 'react-router-dom';

function Header() {
  return (
   <nav className="headerContainer">

    <div>
      <Link to="/">
      <a href="#">Home</a> |
      </Link>
      <Link to="/team">
      <a href="#">Your Team</a> |
      </Link>
    </div>

    <div>
      <Link to="/signin">
      <button>Sign in</button>
      </Link>
      <Link to="/signup">
      <button>Sign up</button>
      </Link>
    </div>
    {/* <a href="#">Battle</a> |
    <a href="#">Add a Hero</a> */}

   </nav>
  );
}

export default Header;
